import React, { Component } from "react";

import NavBar from "../components/NavBar";
import AlertDisplay from "../components/AlertDisplay";
import SatDisplay from "../components/SatDisplay";

const Main = () => {
	return (
		<div className="main">
			<NavBar />
			<AlertDisplay />
			<SatDisplay />
		</div>
	);
};

export default Main;
